import React, { StatelessComponent } from 'react';
import { Container, Row, Col, Form, Button } from 'react-bootstrap'
import Jumbotron from 'react-bootstrap/Jumbotron'

const Content: React.StatelessComponent = () => {
    return(

        <Jumbotron fluid>
          <Container>
            <h1>Speak Up for Our Planet</h1>
            <p>
                We are a grassroots advocacy campaign that wants to empower you to speak up on behalf of our planet and any marginalized peoples.
            </p>

            <p>
                We make it easy for you to contact
            </p>

            <p>
                <Button variant="primary">Learn more</Button>
            </p>
          </Container>
        </Jumbotron>

    );
};

export default Content;
